import React from "react";
import "../styles/Filters.css";

const Filters = ({ onFilterChange }) => {
  return (
    <div className="filters">
      <select onChange={(e) => onFilterChange("city", e.target.value)}>
        <option value="">Select City</option>
        <option value="Casablanca">Casablanca</option>
        <option value="Agadir">Agadir</option>
        <option value="Rabat">Rabat</option>
      </select>
      <select onChange={(e) => onFilterChange("specialty", e.target.value)}>
        <option value="">Select Specialty</option>
        <option value="Orthopedic">Orthopedic</option>
        <option value="Cardiology">Cardiology</option>
      </select>
      <select onChange={(e) => onFilterChange("type", e.target.value)}>
        <option value="0">In-Clinic</option>
        <option value="1">Online Video</option>
      </select>
    </div>
  );
};

export default Filters;
